import React from 'react';
import './App.css';
import Main from './necessary/Main';



function App() {
  return (
    <body>
     <header>
       <ul>
        <span class="button1">메인으로</span>
        <span class="line-2">|</span>
        <span class="button2">정책 페이지</span>
        </ul>
     </header>

    <section>
    <Main/>
    </section>
    </body>
  );
}

export default App;
